import './Home.css';
import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar';
import Stack from '@mui/material/Stack';
import {useNavigate} from 'react-router-dom';

export default function Home() {
  const navigate = useNavigate()
  return (
    <>
      <Stack direction="row" spacing={2}>
        <Avatar
          src="src/logos/harvard.jpg"
          sx={{ width: 60, height: 60 }}
        />
        <Avatar
          src="../../logos/stanford.jpg"
          sx={{ width: 60, height: 60 }}
        />
      </Stack>
      <h1>Welcome to Best-Fit Colleges</h1> 
      <p>Find the best colleges for you.</p>
      <div className = "buttons">
        <Button variant="contained" onClick={() => navigate('Tab1')}>Search Colleges</Button>
        <Button variant="contained" onClick={() => navigate('Tab3')}>School Wishlists</Button>
      </div>
    </>
  );
}
